import { GET_DASHBOARD_DATA } from "./dashboardType";

const getDashboardDataSuccess = (dashboardData) => {
  return {
    type: GET_DASHBOARD_DATA,
    payload: dashboardData,
  };
};
export const getDashboardDataFunction = (dashboardData) => {
  return (dispatch) => {
    if (dashboardData) {
      dispatch(getDashboardDataSuccess(dashboardData));
    }
  };
};
